import React,{Component} from "react";

class Form extends Component{
    constructor(){
        super();
        this.state={
            candName:"",
            candAge:"",
            candRole:"",
            
        }
    }
    render(){
        return(
            <form>
                <label>Candidate Name</label>
                <input type="text" name="candName" value={this.state.candName}/><br/>
                <label>Candidate Age</label>
                <input type="text" name="candAge" value={this.state.candAge}/><br/>
                <label>Candidate Role</label>
                <select name="candRole" value={this.state.candName}>
                    <option>React Dev</option>
                    <option>Node Developer</option>
                    <option>MERN dev</option>
                </select>
                <br/>
                <input type="Submit"/>
            </form>
        )
    }
}

export default Form;
